import React from "react";
import styled from "styled-components";
import AppLayout from "../components/AppLayout";


const Box = styled.div`
    width : 500px;
    height : 500px;
    background-color : skyblue;
    border-radius : 5px;
`;

const Home = () => {
    return (
    <AppLayout>
        <Box>Hello Next</Box>
    </AppLayout>
    );
}

export default Home;
